import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";
import Home from './pages/Home';
import PearlMarket from './pages/PearlMarket';
import ImperialCooking from './pages/ImperialCooking';
import ImperialAlchemy from './pages/ImperialAlchemy';
import Farming from './pages/Farming';


ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
        <Switch>
          <Route exact path='/'><Home/></Route> 
          <Route exact path='/Home'><Home/></Route> 
          <Route exact path='/PearlMarket'><PearlMarket/></Route>
          <Route exact path='/ImperialCooking'><ImperialCooking/></Route>
          <Route exact path='/ImperialAlchemy'><ImperialAlchemy/></Route>
          <Route exact path='/Farming'><Farming/></Route>
        </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
